import React from 'react'

import Item from '../components/Item'

export default function Home(itemDatas) {
    return (
        <div>
            {itemDatas.itemDatas.map((itemData,index) => (
                <Item itemData = {itemData} key={index} />
            ))}
        </div>
    )
}
